                                    Описание от продавца                            
Жилой комплекс «Береке».
⠀
🔑В продаже 1-2-3 комнатные квартиры в новом строящемся жилом комплексе «Береке».
⠀📍Комплекс находится в западной части города, на пересечении улиц Фучика/Чуй.

Дома жилого комплекса Береке представляют собой ансамбль из 4 домов единого архитектурного стиля этажностью до 9 этажей.
⠀➡️Квартиры характеризуются просторной и удобной планировкой, стен и перегородки из жженного кирпича, четырех камерными металлопластиковыми окнами, выполненными в классическом стиле.
⠀➡️Фасадная отделка жилого комплекса, комбинированная с Травертином (Сары-Таш), утепленная базальтовым волокном.

🔑уютная и просторная планировка;
🔑четырёхкамерные окна;
🔑детская площадка;
🔑workout площадка;
🔑баскетбольная площадка;
🔑просторные лифты;
🔑развитая инфраструктура района.

📌стоимость 1м2 - 550$
📌рассрочка на 28 месяцев
📌первоначальный взнос 30%
📌имеется обмен на авто и недвижимость

📲 0770429816

                                    Описание от продавца                            
Продается 3к кв.  с общей площадью - 114,7 м2. на 8-м этаже из 10. Расположен в престижном районе  в Филармонии,  на Турусбекова-Чуй (ул. Шевченко 99Б). В центре столицы, где все находится в шаговой доступности (магазин Народный, школа, Филармония, КНУ, кафе Нават). Дом расположен в тихом месте, что позволяет не слышать шум машин. Заезд к дому с двух улиц, Пушкина и Рыскулова. 

Жилой дом ПРЕМИУМ КЛАССА, состоит из 10-ти этажей, монолитный каркас, заполнение - кирпич. Видеонаблюдение 24/7, огороженная территория, охраняемая парковка.  

 Подведенные коммуникации:
-Центральное отопление;
-Центральное водоснабжение; 
-Центральная канализация;
-Электроснабжение; 
-Полная газификация дома;
    Что в квартире? 
-Высококачественные 5-ти камерные  металлопластиковые, тепло и шумоизоляционные турецкие окна;
-Наружная бронированная дверь;
-Залитая стяжка пола;
-Отштукатуренные стены; 
-Чугунные чежские батареи.
  790 долл. США за 1 кв. м.
Контакты:  0557 225571

